In knowing this I want you to grieve well. I want you to connect to the deep well of grief and allow yourself to feel it. You are built to love & therefore you're built to grieve. In our fear of feeling pain, we want to avoid it in any way possible. This is a good short term coping plan, but it's an awful long term plan. Why? Because the more you avoid something, the harder it will hit you later on. Trust me, grief will wait you out, grief is patient and it will wait. Avoidance is alluring with its promise of numbness but it won't alleviate the grief, it will only prolong it.

‚ùî So, how can you grieve well?

It's simple, but not easy - you need to feel it. You need to allow the feelings to surface, take up space and just feel it. It will pass, it will rise and fall like the waves of the ocean. And I promise you that it won't kill you. I promise that the tears won't last forever and that you WILL be able to breathe again.

Remember, you're built to grieve! Grief is meant to transform us and if we don't allow ourselves to feel it, we cannot be transformed by it. All you will do is spend the rest of your life running from it, so let grief transform you.

‚úçüèΩ I encourage you to do the journal prompts in this post...

‚û° What is grief telling you? What does it need from you?
‚û° How can you begin to make space for grief instead of avoiding it?
‚û° What wisdom have you gained through grief?

